import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-clanmodal',
  templateUrl: './clanmodal.component.html',
  styleUrls: ['./clanmodal.component.css']
})
export class ClanmodalComponent {
  @Input() clan: any;
}
